        public static void fnSetAllLeagues()
        {
            string league = "";
            string tempLeagues = allDivs;
            while (true)
            {
                int pos1 = tempLeagues.IndexOf("<span class=\"navigation-item-name overflow-hidden\">");
                tempLeagues = tempLeagues.Substring(pos1);
                int pos2 = tempLeagues.Substring(2).IndexOf("<span class=\"navigation-item-name overflow-hidden\">");
                if (pos2 != -1)                    
                    league = tempLeagues.Substring(0, pos2+2);
                
                if (pos2 == -1) break;

                int pos3 = league.IndexOf("\">");
                int pos4 = league.IndexOf("</span>");
                string leagueName = league.Substring(pos3+2, pos4-(pos3+2));
                Console.WriteLine(leagueName);
                string tempSubLeagues = league;
                while (true)
                {
                    int pos5 = tempSubLeagues.IndexOf("<span class=\"navigation-item-name\">");
                    tempSubLeagues = tempSubLeagues.Substring(pos5);
                    int pos6 = tempSubLeagues.Substring(2).IndexOf("<span class=\"navigation-item-name\">");
                    if (pos6 != -1)                    
                        league = tempSubLeagues.Substring(0, pos6+2);
                    else
                        league = tempSubLeagues;
                    int pos7 = league.IndexOf("\">");
                    int pos8 = league.IndexOf("</span>");
                    leagueName = league.Substring(pos7+2, pos8-(pos7+2));
                    Console.WriteLine("*** " + leagueName);

                    if (pos6 == -1) 
                        break;
                    tempSubLeagues = tempSubLeagues.Substring(pos6+2);
                }

                tempLeagues = tempLeagues.Substring(pos2+2);
            }
        }
